  \"Survey of contaminants in sediments and fish on the Minnesota Valley National
  Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 13,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:42:22.769201\",\n\t\"name\": \"survey-of-contaminants-in-sediments-and-fish-on-the-minnesota-valley-national-wildlife-ref\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1988, a survey of contaminants in sediments
  and/or fish from three waterbodies on the Minnesota Valley National Wildlife Refuge
  was undertaken. Sediment samples obtained from various locations on Long Meadow
  Lake were analyzed for heavy metals and polycyclic aromatic hydrocarbons (PAHs)
  to assess the nature and extent of urban stormwater discharge-related lakebed contamination.
  Fish obtained from Long Meadow Lake (common carp), Pond C (black bullheads, green
  sunfish) and Round Lake (black bullheads) were analyzed for heavy metals, organochlorine
  insecticides and total PCBs to assess their dietary human and wildlife health implications.
  Various areas of Long Meadow Lake associated with stormwater outfalls were found
  to be moderately to grossly contaminated by PAHs and various metals (e.g., lead,
  copper, manganese, chromium, mercury, and zinc). Pond C bullhead fillets were found
  not to contain harmful levels of lead, as had been previously suspected. Whole common
  carp and black bullheads from Long Meadow and Round Lakes, respectively, were found
  to contain PCB concentrations which exceeded Minnesota's lowest (one meal per week)
  consumption advisory. Additional fish collections from those lakes for analysis
  of skin-on fillets was advised in the event that fishing for consumptive purposes
  was an ongoing activity. Adverse reproductive effects to mink and bald eagles as
  a result of feeding on fish from either lake was judged unlikely. Several recommendations
  for additional studies and management actions are offered.\",\n\t\"license_title\":
